import React from 'react';
import PropTypes from 'prop-types';
import { withStyles } from '@material-ui/core/styles';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import Typography from '@material-ui/core/Typography';

//scrollspy
import Scrollspy from 'react-scrollspy'

//
import { MuiThemeProvider, createMuiTheme } from '@material-ui/core/styles';
import purple from '@material-ui/core/colors/purple';
import Button from '@material-ui/core/Button';

const theme = createMuiTheme({
  palette: {
    primary: { main: purple[500] }, // Purple and green play nicely together.
    secondary: { main: '#11cb5f' }, // This is just green.A700 as hex.
  },
  typography: { useNextVariants: true },
});

const styles = {
  appBar: {
    top: 72,
    position: 'fixed',
    zIndex: 1,
    width: '100%',
  }
};
//

function SimpleAppBar(props) {
  const { classes } = props;

  return (
    <div className={classes.appBar}>
      <AppBar position="static" color="paper">


        <div>
          <MuiThemeProvider theme={theme}>
            <div>
              <Scrollspy style={{paddingLeft: 1}} items={['section-1', 'section-2', 'section-3', 'section-4', 'section-5', 'section-6']} currentClassName="is-current" componentTag="div">                
                <a href="#section-1"><Button color="primary">jan</Button></a>
                <a href="#section-2"><Button color="secondary">feb</Button></a>
                <a href="#section-3"><Button color="primary">mrt</Button></a>
                <a href="#section-4"><Button color="secondary">apr</Button></a>
                <a href="#section-5"><Button color="primary">mei</Button></a>
                <a href="#section-6"><Button color="secondary">jun</Button></a>                
              </Scrollspy>
            </div>
            <div>
              <Scrollspy style={{paddingLeft: 1}} items={['section-7', 'section-8', 'section-9', 'section-10', 'section-11', 'section-12']} currentClassName="is-current" componentTag="span">
                <a href="#section-7"><Button color="primary">jul</Button></a>
                <a href="#section-8"><Button color="secondary">aug</Button></a>
                <a href="#section-9"><Button color="primary">sep</Button></a>
                <a href="#section-10"><Button color="secondary">okt</Button></a>
                <a href="#section-11"><Button color="primary">nov</Button></a>
                <a href="#section-12"><Button color="secondary">dec</Button></a>
              </Scrollspy>
            </div>
          </MuiThemeProvider>
        </div>


      </AppBar>
    </div>
  );
}

SimpleAppBar.propTypes = {
  classes: PropTypes.object.isRequired,
};

export default withStyles(styles)(SimpleAppBar);
